import "./index.css";
import logo from "./images/logo2.svg";

function Footer() {
  return (
    <div className="Footer">
      <div className="social">
        <a href="#">
          <img src={logo} height="130px" width="94px" />
        </a>
        <ul>
          <li>f</li>
          <li>g</li>
          <li>t</li>
          <li>i</li>
        </ul>
      </div>
      <div></div>
      <div></div>
    </div>
  );
}

export default Footer;
